import React from 'react';
import {
  Box,
  Typography,
  Table,
  TableHead,
  TableRow,
  TableCell,
  TableBody,
  Paper,
  TableContainer,
  Divider
} from '@mui/material';

const FormComponentAnesthesia2= ({ title, studentInfo, subjectsData }) => {
  const { rollNumber, name, soName } = studentInfo || {};

  // Calculate grand total
  const grandTotal = subjectsData.reduce((total, subject) => {
    return total + (subject.internalSecured || 0) + (subject.theorySecured || 0) + (subject.practicalSecured || 0);
  }, 0);

  // Number to words conversion (simplified)
  const numberToWords = (num) => {
    const units = ['', 'One', 'Two', 'Three', 'Four', 'Five', 'Six', 'Seven', 'Eight', 'Nine'];
    const teens = ['Ten', 'Eleven', 'Twelve', 'Thirteen', 'Fourteen', 'Fifteen', 'Sixteen', 'Seventeen', 'Eighteen', 'Nineteen'];
    const tens = ['', '', 'Twenty', 'Thirty', 'Forty', 'Fifty', 'Sixty', 'Seventy', 'Eighty', 'Ninety'];

    if (num < 20) return teens[num - 10] || units[num];
    if (num < 100) return tens[Math.floor(num / 10)] + (num % 10 ? ' ' + units[num % 10] : '');
    return num.toString();
  };

  return (
    <Box sx={{ 
      p: 3, 
      maxWidth: 800, 
      mx: 'auto',
      fontFamily: 'Arial',
      border: '1px solid #e0e0e0',
      borderRadius: 1
    }}>
      {/* Header */}
      <Typography variant="h6" align="center" sx={{ fontWeight: 'bold' }}>
        Nizam's Institute of Medical Sciences
      </Typography>
      <Typography variant="body2" align="center" sx={{ fontStyle: 'italic', mb: 2 }}>
        (A University established under the State Act)<br />
        PANJAGUTTA:HYDERABAD -500 082<br />
        TELANGANA STATE, INDIA
      </Typography>

      <Divider sx={{ my: 1, borderWidth: 1 }} />

      {/* Title */}
      <Typography variant="h6" align="center" sx={{ 
        fontWeight: 'bold', 
        textDecoration: 'underline',
        mb: 2 
      }}>
        MEMORANDUM OF MARKS
      </Typography>

      {/* Course Info */}
      <Typography variant="body1" align="center" sx={{ mb: 3 }}>
        COURSE NAME (B.Sc. (Anesthesia Technology))<br />
        Second Year Final Examination held in the month of November-2024
      </Typography>

      {/* Student Info */}
      <Box sx={{ mb: 3 }}>
        <Typography><strong>Roll No:</strong> {rollNumber}</Typography>
        <Typography><strong>NAME:</strong> {name}</Typography>
        <Typography><strong>D/O (or) S/O:</strong> {soName}</Typography>
      </Box>

      {/* Marks Table */}
      <TableContainer component={Paper} sx={{ mb: 3 }}>
        <Table>
          <TableHead>
            <TableRow sx={{ backgroundColor: '#f0f0f0' }}>
              <TableCell>Paper</TableCell>
              <TableCell>Subject</TableCell>
              <TableCell>Internal Assessment Marks</TableCell>
              <TableCell>Theory Marks Secured</TableCell>
              <TableCell>Practicals Marks Secured</TableCell>
              <TableCell>Result</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {subjectsData.map((subject, index) => (
              <TableRow key={index}>
                <TableCell>{subject.paper || index + 1}</TableCell>
                <TableCell>{subject.subject}</TableCell>
                <TableCell>{subject.internalSecured || '-'}</TableCell>
                <TableCell>{subject.theorySecured || '-'}</TableCell>
                <TableCell>{subject.practicalSecured || '-'}</TableCell>
                <TableCell>{subject.result || 'Pass'}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      {/* Grand Total */}
      <Typography variant="body1" sx={{ mb: 2 }}>
        <strong>Grand Total in Words:</strong> {numberToWords(grandTotal)} (Grand Total: {grandTotal})
      </Typography>

      {/* Footer */}
      <Box sx={{ mt: 4, textAlign: 'right' }}>
        <Typography>Dated: {new Date().toLocaleDateString()}</Typography>
        <Typography sx={{ mt: 3 }}><strong>EXECUTIVE REGISTRAR</strong></Typography>
      </Box>

      {/* Legend */}
      <Typography variant="caption" sx={{ mt: 2, display: 'block' }}>
        AP: Already Pass; AB: Absent; NA: Not applicable; *Fail.
      </Typography>
    </Box>
  );
};

export default FormComponentAnesthesia2;
